import React from "react";
import { Paper, Divider, } from "@material-ui/core";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../Theme/themes";
import { BrandType } from "../../types/brand";
import { styles } from "../styles";
import Tabs from "../Tabs";

const useStyles = makeStyles((theme) => ({
    ...styles,
    rootBg: {
        background: theme.palette.primary.main,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type TabsStoryProps = {
    mode: string,
    brand: BrandType
}

const TabsStory = ({
    mode, brand
}: TabsStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="Tabs">
                <Typography variant="h3">Tabs</Typography>
                <br />
                <Divider />
                <br />
                <Tabs
                    selected={{
                        label: "Tab 1",
                        content: "tab 1 content",
                    }}
                    classes={classes}
                    content={[
                        {
                            label: "Tab 1",
                            content: "tab 1 content",
                        },
                        {
                            label: "Tab 2",
                            content: "tab 2 content",
                        },
                        {
                            label: "Tab 3",
                            content: "tab 3 content",
                        },
                    ]}
                />
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "rootBg",
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["rootBg", "darkBg"]
        },
    }
}

storiesOf("Components/Tabs", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", (args) => <TabsStory {...args}/>, argsControls);
